    public static RELATIONSHIP_BOBBA: string = 'RWUAM_RELATIONSHIP_BOBBA';


    private _userId: number;

    constructor(type: string, userId: number)
    {
        super(type);

        this._userId = userId;
    }

    public get userId(): number
    {
        return this._userId;
    }
}
